import { FC } from "react";

export const UsersListButton: FC = () => {
  const users = [
    { id: 1, avatar: "https://i.pravatar.cc/150?img=1" },
    { id: 2, avatar: "https://i.pravatar.cc/150?img=2" },
    { id: 3, avatar: "https://i.pravatar.cc/150?img=3" },
    // { id: 4, avatar: "https://i.pravatar.cc/150?img=4" },
    // { id: 5, avatar: "https://i.pravatar.cc/150?img=5" },
  ];
  return (
    <div className="flex relative border h-[40px] w-28">
      <button>
        <img
          alt="img"
          className="absolute z-[9] w-10 h-10 top-0 rounded-full border-2 border-white"
          src={users[0].avatar}
        />
      </button>
      <button>
        <img
          alt="img"
          className="absolute w-10 h-10 z-[10] top-0 rounded-full ml-[20px] border-2 border-white"
          src={users[1].avatar}
        />
      </button>
      <button>
        <img
          alt="img"
          className="absolute w-10 h-10 z-[10] top-0 rounded-full ml-[40px] border-2 border-white"
          src={users[2].avatar}
        />
      </button>
      {users.map((user, index) => (
        <button key={user.id}>
          <img
            className={`absolute w-10 h-10 z-[10] top-0 rounded-full ml-[${index * 10 + 10}px] border-2 border-white`}
            src={user.avatar}
            alt={`User ${user.id}`}
          />
        </button>
      ))}
    </div>
  );
};
